  \"A Breeding Bird Survey of the West Mountain Wildlife Management Area and the Nulhegan
  Basin Division of the Silvio O. Conte National Fish and Wildlife Refuge\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:33.120440\",\n\t\"name\": \"a-breeding-bird-survey-of-the-west-mountain-wildlife-management-area-and-the-nulhegan-basi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this study were to: 1)
  Create a list of birds occurring in the study area during the breeding season; 2.)
  Identify species and habitats of management interest; 3) Associate species with
  specific natural community types; 4) Produce an index of relative abundance for
  each species; 5) Establish a baseline for monitoring changes in local populations;
  and 6) Document the distribution of rare species. Results are intended to help land
  managers in and around the study area develop stewardship priorities and predict
  effects of management activity. Continued bird study will help to evaluate changes
  in the area's avian community resulting from their conservation efforts.\",\n\t\"license_title\":
